import React, { useContext, useState } from 'react';
import Sidebar from '../../Components/Sidebar';
import api from "../../../api/api";
import Swal from 'sweetalert2';
import { Link, useNavigate } from 'react-router-dom';
import "./Styles.css";
import { AuthContext } from '../../../Context/AuthContext';

export default function CreateServiceData() {

    const { user } = useContext(AuthContext);


    const navigator = useNavigate();

    const [formData, setFormData] = useState({
        name: '',
        duration: '',
        gender: 'Masculino', // Establecer un valor predeterminado
        type: 'Corporal', // Establecer un valor predeterminado
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (user.permisos?.servicios.editar) {

            try {
                // Convertir la primera letra de gender y type a mayúscula
                const formattedData = {
                    ...formData,
                    gender: formData.gender.charAt(0).toUpperCase() + formData.gender.slice(1),
                    type: formData.type.charAt(0).toUpperCase() + formData.type.slice(1),
                };

                const response = await api.post('/service', formattedData);

                if (response.status === 200) {
                    // El servicio se creó exitosamente, puedes redirigir o mostrar un mensaje de éxito aquí.
                    console.log('Servicio creado exitosamente');
                    // Redirigir a la página de servicios o realizar alguna otra acción.

                    Swal.fire({ 
                        icon: 'success',
                        iconHtml: '<img src="https://www.easy-gst.in/wp-content/uploads/2017/07/success-icon-10.png" alt="Icono personalizado" width="98">',
                        title: '¡Servicio creado exitosamente!',
                        showConfirmButton: false,
                        timer: 1500, // 1.5 segundos
                    });

                    setTimeout(() => {
                        navigator('/servicios');
                    }, 1500); // 
                }
            } catch (error) {
                // Manejar errores si es necesario
                console.error('Error al crear el servicio:', error);
            }

        } else {

            Swal.fire({
                icon: 'error',
                iconHtml: '<img src="https://cdn.icon-icons.com/icons2/317/PNG/512/sign-error-icon_34362.png" width="125">',
                title: '¡No tienes Permisos!',
                showConfirmButton: false,
                timer: 1500, // 1.5 segundos
            });
        }

    };

    return (
        <>
            <Sidebar />
            <div className="container-fluid mt-5">
                <div className="row justify-content-center">
                    <div className="col-sm-8">

                        {user.permisos?.servicios.ver ? (
                            <div>
                                <h2>Crear Nuevo Servicio</h2>
                                <form onSubmit={handleSubmit}>
                                    <div className="form-group">
                                        <label>Nombre del Servicio:</label>
                                        <input
                                            type="text"
                                            className="form-control"
                                            name="name"
                                            value={formData.name}
                                            onChange={handleChange}
                                            required
                                        />
                                    </div>
                                    <div className="form-group">
                                        <label>Duración (en minutos):</label>
                                        <input
                                            type="number"
                                            className="form-control"
                                            name="duration"
                                            value={formData.duration}
                                            onChange={handleChange}
                                            required
                                        />
                                    </div>
                                    <div className="form-group">
                                        <label>Género:</label>
                                        <select
                                            className="form-control"
                                            name="gender"
                                            value={formData.gender}
                                            onChange={handleChange}
                                            required
                                        >
                                            <option value="Masculino">Masculino</option>
                                            <option value="Femenino">Femenino</option>
                                        </select>
                                    </div>
                                    <div className="form-group">
                                        <label>Tipo:</label>
                                        <select
                                            className="form-control"
                                            name="type"
                                            value={formData.type}
                                            onChange={handleChange}
                                            required
                                        >
                                            <option value="Corporal">Corporal</option>
                                            <option value="Facial">Facial</option>
                                            <option value="Bronceado">Bronceado</option>
                                        </select>
                                    </div>
                                    <button type="submit" className="main-button">Crear Servicio</button>  &nbsp; &nbsp;
                                    <Link to="/servicios"><button type="submit" className="main-close">Regresar</button></Link>
                                </form>
                            </div>
                        ) : (<div className='col-sm-5 mt-5'><p>No tienes Permisos</p></div>)}

                    </div>
                </div>
            </div>
        </>
    );
}
